import React from "react";
// import { Container } from 'react-bootstrap';
import { Navbar } from 'react-bootstrap';

export function NavBar(props) {
  const NAV_DATA = [
    { 
        name: "Dashboard",  
        image: '/assets/icons8-home-48.png', 
        alt: "Dashboard Page" 
    },
    {
        name: "Diary",
        image: '/assets/icons8-journal-50.png',
        alt: "Diary entries",
    },
    {
        name: "Buddy",
        image: '/assets/icons8-wolf-32.png',
        alt: "Buddy",
    },
    { 
        name: "Settings", 
        image: '/assets/icons8-settings-50.png', 
        alt: "Settings" 
    },
  ];
  const navArray = NAV_DATA.map((navObj) => {
    const navElem = (
        <Navbar.Brand to={`/${navObj.name}`} key={navObj.name}>
            <img
                src={navObj.image}
                width="30"
                height="30"
                className="d-inline-block align-top"
                alt={navObj.alt}
            />
        </Navbar.Brand>
    );
    return navElem;
  });
  return (
    <Navbar className="flex bg-body-tertiary" fixed='bottom'>{navArray}</Navbar>
  );
}
